    false,nt"url": null,nt"notes": "This narrative report for Upper Souris
    National Wildlife Refuge outlines Refuge accomplishments from February through April
    of 1940. The narrative starts off with summarizing weather conditions. Wildlife-
    including migratory birds, upland game birds, furbearers, predators, rodents, and
    raptors- are included. The Refuge development and maintenance section discusses
    physical developments, plantings, and collections and receipts. The public relations
    section details recreational uses and Refuge violations. Resource management is
    described; topics include timber removal. Photographs are attached.",nt"license_title":
